import Button from "./Button";
import Card from "./Card";
import classes from "./ErrorModal.module.css"
const ErrorModal =(props)=>{
    return(
       <div>
            <div className={classes.backdrop}/>
        <Card className = {classes}>
            <header>
                <h2>Error</h2>
            </header>
            <div>
                <p>Заполните поля</p>
            </div>
            <footer>
                <Button>Okay</Button>
            </footer>
        </Card>
       </div>
    )


}
export default ErrorModal;
